(14, 'Thiết Kế Đồ Họa', 'thiet-ke-do-hoa', 'a:4:{s:8:"subtitle";s:51:"Đưa ý tưởng đến gần với cuộc sống.";s:4:"desc";s:336:"Chúng tôi không biết điều gì sẽ cứu vãn thế giới, nhưng chúng tôi chắc chắn rằng bất kể nó là gì, nó phải được thiết kế hoàn hảo. Cho dù đó là đồ họa, bố cục quảng cáo hoặc thiết kế bao bì, hoạt động của chúng tôi thúc đẩy mọi người hành động.";s:5:"cover";s:31:"/assets/creative/images/107.jpg";s:5:"links";s:119:"<li>Thiết Kế Ấn Phẩm.</li>\n<li>Làm & Chỉnh Sửa Phim/Clip.</li>\n<li>Thiết Kế Bao Bì Sản Phẩm.</li>";}', '2017-05-15 21:57:19', '2017-05-29 00:11:04', 'services', 1, NULL, NULL, 22),
(15, 'Thiết Kế & Phát Triển Website/App', 'thiet-ke-phat-trien-websiteapp', 'a:4:{s:8:"subtitle";s:63:"Hãy để chúng tôi thay bạn tạo nên sự khác biệt.";s:4:"desc";s:420:"Tùy thuộc vào nhiệm vụ, chúng tôi sẽ nghĩ về một vài bước tiếp theo trong mong muốn của khách hàng về quá trình phát triển website của họ dựa trên những giải pháp của chúng tôi, cho dù đó là thiết kế hoặc công nghệ được sử dụng. Kết quả là có dễ sử dụng, thỏa mái, thực tiễn và hỗ trợ sản phẩm trên mọi thiết bị.";s:5:"cover";s:23:"/data/image/img/108.jpg";s:5:"links";s:120:"<li>Đáp ứng cho mọi thiết bị.</li>\n<li>Thiết kế UX/UI.</li>\n<li>Thiết kế website dành cho mobile</li>";}', '2017-05-15 22:03:13', '2017-05-29 00:40:43', 'services', 1, NULL, NULL, 21),
